import Main from './Main/main'
import Scroll from "./Scroll/scroll";
import Accord from "./AcordionSection/accord";
import Footer from "./Footer/footer";

function App() {
  return (
    <div>
      <Header/>
      <Main/>
      <Scroll/>
      <Accord/>
      <Footer/>

    </div>
  );
}

export default App;
